with open("input.txt","r") as file:    #wirh open("output.txt","w") as output:    list=[]    T=int(file.readline())    for i in range(T):        line=file.readline()        list.append(line)    list.sort()        for i in range(len(list)):        for j in range(i+1,len(list)):            if list[i].split(" ")[0]==list[j].split(" ")[0]:                if list[i].split(" ")[-1][0:2]>=list[j].split(" ")[-1][0:2]:                    continue                elif list[i].split(" ")[-1][0:2]==list[j].split(" ")[-1][0:2]:                    if list[i].split(" ")[-1][3:5]>list[j].split(" ")[-1][3:5]:                        continue                    else:                        temp=list[i]                        list[i]=list[j]                        list[j]=temp                else:                    temp=list[i]                    list[i]=list[j]                    list[j]=temp    with open("output.txt","w") as output:        for a in list:            output.write(a+"\n")